import { Formik , Form } from "formik";
import React, { Component } from "react";

const RegisterForm = () => {
  return (<Formik initialValues={{
    username : "",
    password : "",
  }}>
    {(props) => (
        <div className="login-card d-flex align-items-center justify-content-center">
            <Form className="inner-login-card d-flex flex-column">
                <label className="mb-3" htmlFor="username">Username</label>
                <input name="username" type="text" id="username" value={props.values.username}  />
                <label htmlFor="password">Password</label>
                <input name="password" type="text" id="password" value={props.values.password} />
            </Form>
        </div>
    )}
  </Formik>);
};

export default RegisterForm;
